import React, { Component } from 'react';



export default function WeatherWidget(props){


    return(
        <div className='Widget'>

            <h3 className='city'>{props.data.location.name}</h3>
            <img alt="icon" src='props.data.current.condition.icon'/>
            <p className='weather-info'>{props.data.current.condition.text} </p>
            <p className='weather-info'> Temperature : {props.data.current.temp_c}</p>
            <p className='weather-info'> Humidity : {props.data.current.humiditity}</p>
            <p className='weather-info'> Wind Speed : {props.data.current.wind_kph}</p>




        </div>
    )

}
